pragma solidity >= 0.5.0 < 0.9.0;

contract if_else{
    function for_if_else(int a) public view returns(string memory){
        string memory value;
        if(a >= 0){
            value = 'Value is greater than zero';
        }else if(a == 0) {
            value = "Value is equal to zero";
        }else{
            value = "Value is less than zero";
        }
        return value;
    }
}

